    [TestMethod]
    public void TestMethodSimple250_000a250_000b_K2000()
    {
        Solution solution = new Solution();
        var aList = Enumerable.Repeat('a', 250_000).ToArray();
        var bList = Enumerable.Repeat('b', 250_000).ToArray();
        var list = aList.ToList();
        list.AddRange(bList);
        var result = solution.PossibleStringCount(
            new string(list.ToArray())
            , 2000);

        long sum = 0;
        long A = (250_000L - 1999L + 1L) * 250_000L;
        A %= Solution.Modulo;
        long B = (250_000L * 1998L % Solution.Modulo) - ((1998L / 2L) * 1999L % Solution.Modulo);
        B %= Solution.Modulo;

        var total = A + B;
        total %= Solution.Modulo;
        Assert.AreEqual(total, result);
    }

    [TestMethod]
    public void TestMethodSimple25a25b_k10()
    {
        Solution solution = new Solution();
        var length = 25;
        var k = 10;
        var aList = Enumerable.Repeat('a', length).ToArray();
        var bList = Enumerable.Repeat('b', length).ToArray();
        var list = aList.ToList();
        list.AddRange(bList);
        var result = solution.PossibleStringCount(
            new string(list.ToArray())
            , k);
        int total = length * length - (k - 2) * (k - 1) / 2;
        Assert.AreEqual(total, result);
    }

    [TestMethod]
    public void TestMethodSimple25ia25ib_K10i()
    {
        Solution solution = new Solution();
        var length = 25;
        var k = 25;
        for (int i = 1; i < 3; i++)
        {
            length *= 10;
            k *= 10;
            var aList = Enumerable.Repeat('a', length).ToArray();
            var bList = Enumerable.Repeat('b', length).ToArray();
            var list = aList.ToList();
            list.AddRange(bList);
            var result = solution.PossibleStringCount(
                new string(list.ToArray())
                , k);
            int total = length * length - (k - 2) * (k - 1) / 2;
            Assert.AreEqual(total, result);
        }
    }

